import { useContext } from 'react'
import Global from '../../context/Global'
import { DataPathRouterItemsType } from "../../types/types"
import LogInPage from "../../pages/LogInPage"
import SignInPage from "../../pages/SignInPage"

const {localStore} = useContext(Global)

export const DataPublick: DataPathRouterItemsType = [
    {
        path: '/',
        element: <LogInPage />,
        id: 0,
    }
]

export const DataPrivate: DataPathRouterItemsType = [
    {
        path: '/',
        element: localStore.User.isAuth ? <SignInPage /> : undefined, //! undefined will be element / component "WorldPosts"
        id: 0
    },
    {
        path: '/MyPosts',
        element: undefined,
        id: 1
    },
    {
        path: '/WorldPosts',
        element: undefined,
        id: 2
    },
    {
        path: '/Profile',
        element: undefined,
        id: 3
    },
    {
        path: '/AboutThisProject',
        element: undefined,
        id: 4
    },
    {
        path: '/AboutMe',
        element: undefined,
        id: 5
    }
]
